import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import SignUp from './components/SignUp';
import HomePage from './components/HomePage';
import logoImage from './Images/LOGOIMAGE.PNG'; // 이미지 파일 import
import './App.css'; // App 컴포넌트에서 사용할 CSS 파일
import Grid from './components/Grid'; // Import Grid component
import SearchBar from './components/SearchBar';
import { Card } from 'antd'; // Import Card component from Ant Design
import Sidebar from './components/Sidebar'; // Import Sidebar component
const { Meta } = Card;

const App = () => {
    const [darkMode, setDarkMode] = useState(false);

    useEffect(() => {
        const body = document.body;
        if (darkMode) {
            body.classList.add('dark-mode');
        } else {
            body.classList.remove('dark-mode');
        }
    }, [darkMode]);

    const toggleDarkMode = () => {
        setDarkMode(prevMode => !prevMode);
    };

    return (
        <Router>
            <div className={`App ${darkMode ? 'dark-mode' : ''}`}>
                {/* Sidebar */}
                <Sidebar />

                {/* Main content */}
                <div className="main-content">
                    {/* Toggle Button */}
                    <button className="toggle-button" onClick={toggleDarkMode}>
                        {darkMode ? '라이트 모드로 전환' : '다크 모드로 전환'}
                    </button>

                    {/* Logo Image */}
                    <img src={logoImage} alt="Logo" className="logo-image" />

                    {/* Grid Component */}
                    <Grid />

                    {/* Search Bar Component */}
                    <SearchBar />

                    {/* Card Container */}
                    <div className="card-container">
                        <Card
                            hoverable
                            style={{ width: 240 }}
                            cover={<img alt="example" src="data:image/jpeg;base64," />}
                        >
                            <Meta title="클래식 만찬 신청 링크" description="" />
                        </Card>

                        <Card
                            hoverable
                            style={{ width: 240 }}
                            cover={<img alt="example" src="data:image/jpeg;base64," />}
                        >
                            <Meta title="버스킹 공연 신청 링크" description="" />
                        </Card>

                        <Card
                            hoverable
                            style={{ width: 240 }}
                            cover={<img alt="example" src="data:image/jpeg;base64," />}
                        >
                            <Meta title="임영웅 ImHero 콘서트 예매 링크" description="" />
                        </Card>

                        <Card
                            hoverable
                            style={{ width: 240 }}
                            cover={<img alt="example" src="data:image/jpeg;base64," />}
                        >
                            <Meta title="국악 마당 예매 링크" description="" />
                        </Card>
                    </div>
                </div>

                {/* Router and Routes */}
                <Routes>
                    <Route path="/" element={<HomePage toggleDarkMode={toggleDarkMode} />} />
                    <Route path="/signup" element={<SignUp />} />
                </Routes>
            </div>
        </Router>
    );
};

export default App;
